import React from 'react'
import footerLogo from '../assets/images/png/footer-logo.png'

const Footer = () => {
  return (
      <div className='bg-black pt-[78px] pb-16'>
          <div className='container'>
              <img src={footerLogo} alt="logo" className=''/>
          </div>
    </div>
  )
}

export default Footer
